import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./Components.css";

class LandingPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      videoURL:
        "http://www.sample-videos.com/video/mp4/720/big_buck_bunny_720p_1mb.mp4"
    };
  }

  render() {
    return (
      <div>
        <video id="background-video" loop autoPlay>
        <div style="width:100%;height:0px;position:relative;padding-bottom:56.250%;"><iframe src="https://streamable.com/s/5fq63/gpvptn?autoplay=1&muted=1" frameborder="0" width="100%" height="100%" allowfullscreen style="width:100%;height:100%;position:absolute;left:0px;top:0px;overflow:hidden;">


            </iframe></div>

          <h1>Artist Search</h1>
          <div className="button">
            <button>
              <Link to="/homepage">Enter</Link>
            </button>
          </div>
        </video>
      </div>
    );
  }
}

export default LandingPage;
